import React, { Component } from "react";
import Header from "./components/header";
import Main from "./components/main";
import Footer from "./components/footer";
import "./App.css";

function App() {
	return (
		<div className='todo-container'>
			<Header />
			<Main />
			<Footer />
		</div>
	);
}



export default App;
